INSERT INTO `tbl_memo` (`memo_id`, `memo_author`, `memo_audience`, `memo_content`, `who_read`, `memo_time`) VALUES
(1, '1', 'Writers', '<div dir=\"auto\">Message to all Researchers.</div>\r\n<div dir=\"auto\"> </div>\r\n<div dir=\"auto\"> </div>\r\n<div dir=\"auto\">Do not rely on Turnitin to make your work original. There are stronger plagiarism checkers than Turnitin used by the companies, which may provide even 50% plagiarism score when Turnitin provides 0%. Use your own words unless the client requires direct quotes.</div>\r\n<div dir=\"auto\">Otherwise, you don\'t need Turnitin if you use your own words.</div>\r\n<div dir=\"auto\">Lastly, having 0% on Turnitin doesn\'t entirely mean that your work is original if at all you paraphrased most of the content online instead of interpreting and using your own words.</div>\r\n<div dir=\"auto\"> </div>\r\n<div dir=\"auto\">A Secret:</div>\r\n<div dir=\"auto\">Most fast and productive writers, who complete more than 10 pages per day without even feeling it do not paraphrase online content, they interpret and write in their own words.</div>\r\n<div dir=\"auto\"> </div>\r\n<div dir=\"auto\">Editor</div>', '', '2019-04-28 09:03:55');
