(95, '293663984_RESEARCH PAPER- report based on a hypothetical research study./4 PAGES/ BAY2', 0, 'chris makori', '<p> </p>\r\n<div><img src=\"blob:https://mail.google.com/36575a51-e1a7-4ceb-b885-e7594e62c715\" alt=\"image.png\" data-surl=\"cid:ii_juy779me0\"></div>\r\n<div class=\"sign\">                                                                      Paper details  </div>\r\n<p> </p>\r\n<p>Write a research report based on a hypothetical research study. Conducting research and writing a report is common practice for many students and practitioners in any of the behavioral sciences fields. <br><br>A research report, which is based on scientific method, is typically composed of the different sections listed below:<br><br>Introduction: The introduction states a specific hypothesis and how that hypothesis was derived by connecting it to previous research. <br>Methods: The methods section describes the details of how the hypothesis was tested and clarifies why the study was conducted in that particular way. <br>Results: The results section is where the raw uninterpreted data is presented. <br>Discussion: The disc', 4, 0, '2019-04-26 14:59:00', '2019/04/27 12:00', '26', 'April', '2019', '', '', '', 2400, 325, 1300, 'POSTED'),
(96, '293639242_MEMORANDUM/2 PAGES/ BAY 2', 0, 'John Juma Wafula', '<p> </p>\r\n<div><img src=\"blob:https://mail.google.com/734346b6-5156-4560-b8ac-c3b1380e3cc6\" alt=\"image.png\" data-surl=\"cid:ii_juyfrp290\"></div>\r\n<table class=\"table-details table-striped\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"99\">\r\n<div class=\"sign\">Paper details  </div>\r\n<p>The paper should be 550 words long .All instructions will be uploaded in files</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"99\">Preferred language style   Simple US English(Easy vocabulary, simple grammar constructions)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>We would like to remind you that if the client has indicated \"No specific sources needed\" it means that there are no requirements on the number of sources to be used, however, you still have to include in-text citations for all the borrowed ideas along with a works cited page.<br><br>As you know, each and every part of the work that has been taken from outside sources needs to be referenced, otherwise, it will be considered as plagiarism.</p>\r\n<p>THIS IS JUST SOME BASIC INFORMAT', 2, 0, '2019-04-26 18:59:13', '2019/04/27 08:00', '26', 'April', '2019', '', '', '', 1100, 325, 650, 'POSTED'),
