(100, '293768587_QUESTION AND ANSWER-Philosophy answer questions at bottom/1 PAGE/BAY 2', 0, 'WEKESA B KESTONE', '<p> </p>\r\n<div><img src=\"blob:https://mail.google.com/a7449755-cfeb-45e3-a47b-c99307a198af\" alt=\"image.png\" data-surl=\"cid:ii_juz5ns7c0\"></div>\r\n<div class=\"sign\">                                                                      Paper details  </div>\r\n<p> </p>\r\n<p>1. Utilitarianism is a moral theory, which is premised on the idea that an act is only moral or right when it benefits the majority or when the majority finds it useful. An example of utilitarian actions, which take place in the modern day corporate world is the use of tiered pricing of air tickets by the leading airlines. Tiered pricing strategy presents the customer with three different prices, the first class, which is costly, the middle-class, which is relatively affordable, and the economy class, which is affordable to may. In this pricing strategy, clients are at liberty of booking the seats, which makes them happy and comfortable. The services provided to all the passengers on board are the same regardless of the c', 1, 0, '2019-05-22 05:39:42', '2019/04/27 13:00', '27', 'April', '2019', '', '', '', 700, 275, 275, 'APPROVED');
